import React from "react";
import "./SuggestAdventurePopup.scss";

function SuggestAdventurePopup() {
  return (
    <div className="popup" onClick={() => launchSuggestAdventurePopup()}>
      <div className="popup-content">text content</div>
    </div>
  );
}

function launchSuggestAdventurePopup() {
    ReactDOM.render(
      <SuggestAdventurePopup />,
      document.getElementById("popup-root")
    );
  }

export default SuggestAdventurePopup;
